import React from "react";

function MatchPage({matched, setMatch}) {

    function handleMatched() {
        const matchedArray = cats.filter((cat) => {
            if(cat.id === matched.id) {
                return cat
            }
        })
        setMatch(matchedArray)
    }
    return (
        <Container>
        <Row>
              {cats.map((cat) => (
              <Col sm key={cat.id}>

                          <CatCard 
                              id={cat.id}
                              image={cat.url}
                              name={cat.name}
                              favoritemovie={cat.favoriteMovie}
                              age={cat.age}
                              pickupLine={cat.pickupLine}
                              matched={matched} 
                              setMatch={setMatch}
                          />
              </Col>
          ))}
        </Row>
      </Container>
    ) 
}

export default MatchPage
